                        </div>
                    </div>
                </div>
                <i class=""icon-info-blocks fa fa-lightbulb-o""></i>
                <div class=""info-blocks-in"">
                    <h3>Teleki Domain(Castle)</h3>
               ");
            WriteLiteral(@"     <p>
                        Teleki Castle in Gorneti (Hungarian Teleki-kastly) is an architectural ensemble built by the Teleki family in the town of Gorneti,
                        Mure County. Named ""the most beautiful castle in Transylvania"" and ""Mure treasure"", the complex is 17 km away from Trgu Mure, on the
                        left side of the Mure river, being built in the Grassalkovich style, very widespread in the Kingdom of Hungary. It was designed by the
                        architect Andreas Mayerhoffer in Salzburg, being similar to the palaces in Gdll and Pecel, made by him. Teleki Castle is located
                        within an impressive dendrological park with allegorical statues.
                    </p>
                </div>
            </div>
            <div class=""col-sm-4 info-blocks"">
                <div class=""row"">
                    <div class=""col-md-12"">
                        <div class=""about-logo"">
                            <h2><spa");
            WriteLiteral(@"n style=""color:cadetblue"">Most Popular Places from Craiova</span></h2>
                        </div>
                    </div>
                </div>
                <i class=""icon-info-blocks fa fa-lightbulb-o""></i>
                <div class=""info-blocks-in"">
                    <h3>""Marin Sorescu"" National Theatre</h3>
                    <p>
                        ""Marin Sorescu"" National Theater, Craiova, formerly known as Craiova National Theater, is a public cultural theater institution funded by
                        the Ministry of Culture and National Identity. Founded in 1850, the theater was named after the culture man and universal writer Marin
                        Sorescu, in the years after the 1989 Revolution. The current building of the Craiova theater, a true architectural symbol of the city,
                        created by the architect Alexandru Iotzu, was inaugurated on April 21, 1973.
                    </p>
                </div>
            </div>
        </d");
            WriteLiteral(@"iv>
        <!-- End Info Blcoks -->
        <!-- Info Blcoks -->
        <div class=""row"">
            <div class=""col-sm-4 info-blocks"">
                <i class=""icon-info-blocks fa fa-lightbulb-o""></i>
                <div class=""info-blocks-in"">
                    <h3>Romanian Athenaeum</h3>
                    <p>
                        The Romanian Athenaeum (Romanian: Ateneul Romn) is a concert hall in the center of Bucharest, Romania and a landmark of the Romanian
                        capital city. Opened in 1888, the ornate, domed, circular building is the city's main concert hall and home of the ""George Enescu""
                        Philharmonic and of the George Enescu annual international music festival.
                    </p>
                </div>
            </div>
            <div class=""col-sm-4 info-blocks"">
                <i class=""icon-info-blocks fa fa-lightbulb-o""></i>
                <div class=""info-blocks-in"">
                    <h3>Palace Of Culture</h3");
            WriteLiteral(@">
                    <p>
                        The Palace of Culture (Romanian: Palatul Culturii, Hungarian: Kultrpalota) is an edifice located in the centre of Trgu Mure
                        (Marosvsrhely), Romania. The building houses the Mure County Library, the Mure County Museum, and the State Philharmonic of
                        Trgu Mure. The Palace of Culture of Trgu Mure is listed in the National Register of Historic Monuments.
                    </p>
                </div>
            </div>
            <div class=""col-sm-4 info-blocks"">
                <i class=""icon-info-blocks fa fa-lightbulb-o""></i>
                <div class=""info-blocks-in"">
                    <h3>Craiova Art Museum</h3>
                    <p>
                        The Craiova Art Museum (Romanian: Muzeul de Art din Craiova) is an art museum in the city of Craiova, Oltenia, Romania. The museum
                        is housed in the Constantin Mihail Palace, built from 1898 to 1907 acco");
            WriteLiteral(@"rding to the plans of French architect Paul Gottereau. The
                        palace once belonged to Michael Constantine (18371908), a member of one of the richest families in Romania and is known as Jean
                        Mihail Palace. The palace is decorated with Carrara marble stairs, Lyon silk walls, Murano glass chandeliers, painted ceilings,
                        partly gilded stucco, and Venetian mirrors. It has hosted kings of Romania, in 1939 the exiled Polish president Ignacy Mocicki
                        (18671946), and the former Yugoslav leader Josip Broz Tito (18921980).
                    </p>
                </div>
            </div>
